import React from "react";
import human from "../../../Image/human.jpg";
import "./Profil.css";
import ListProfile from "./ListProfile";

class Profil extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="wrapp">
          <div class="container">
  <br/><br/>
  <div class="dropdown ">
    <a href="##" id="drop1" data-toggle="dropdown" class="btn btn-default dropdown-toggle" role="button">Dropdown <span class="caret"></span></a>
    <ul role="menu" class="dropdown-menu" aria-labelledby="drop1">
      <li role="presentation">
        <a href="##" role="menuitem">Link 1</a>
      </li>
      <li role="presentation">
        <a href="##" role="menuitem">Cell</a>
      </li>
      <li role="presentation">
        <a href="##" role="menuitem">Science</a>
      </li>
    </ul>
  </div>
</div>
        <div class="form-group has-search">
          <span class="fa fa-search form-control-feedback"></span>
          <input
            type="text"
            class="form-control shadow-none"
            placeholder="Search Your Contact . . ."
          />
        </div>
        <div className="list-profile">
          <ListProfile />
        </div>
      </div>
    );
  }
}

export default Profil;
